import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import EnseignantList from './enseignant/EnseignantList';
// Import other components like EleveList here

const App = () => {
  return (
    <Router>
      <div className="container">
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
          <Link className="navbar-brand" to="/">School Management</Link>
          <div className="collapse navbar-collapse">
            <ul className="navbar-nav mr-auto">
              <li className="nav-item">
                <Link className="nav-link" to="/enseignants">Enseignants</Link>
              </li>
              <li className="nav-item">
              </li>
              {/* Add more links for other sections like "Authentification", "Etudiant", etc. */}
            </ul>
          </div>
        </nav>

        <Switch>
          <Route path="/enseignants" component={EnseignantList} />
          {/* Add more routes for other sections */}
        </Switch>
      </div>
    </Router>
  );
};

export default App;
